webpackJsonp([0xc914158a129a],{5396:function(t,a){t.exports={data:{post:{html:'<p>Here\'s my schedule for the next 6 days. </p>\n<ul>\n<li>Last day of work, have about a week\'s worth of stuff to finish up, company Christmas party in evening.\n</li>\n<li>Fly to Munich for Mama\'s national company Christmas party in evening (hopefully <i>without</i> traditional Bavarian music) ";->"\n</li>\n<li>Fly back from Munich, last chance to shop\n</li>\n<li>Pack, stores closed\n</li>\n<li>Fly to Minnesota (HAM-AMS-MSP)\n</li>\n<li>Collapse into coma</li>\n</ul>\n<p>Actually, I\'m ready for the coma part already.</p>\n<p>Ack! Today on the <a href="http://www.bildarchiv-hamburg.de/hamburg/strassen/millerntor/index2.htm">billboard across from my office</a> (pictures 3 and 4) they put up a giant 50 foot <a href="http://www.apple.com/ipod/">iPod</a>!</p>',fields:{title:"Frantic",date:"06 Dec 2001",url:"https://papascott.de/2001-12-06-frantic/"}}},pathContext:{slug:"/2001-12-06-frantic/",prev:{fields:{title:"Still Working",date:"05 Dec 2001",slug:"/2001-12-05-still-working/"}},next:{fields:{title:"Frozen",date:"09 Dec 2001",slug:"/2001-12-09-frozen/"}}}}}});
